I’m sharing more about my hair loss journey in my stories today. This has been such a traumatic experience. And it’s happened so quickly. It’s only been two months since I found my first bald spot. I still can’t believe all that has happened since then. I wish I was talking to you from the other side of this, telling my story. But I’m still right in the middle of it all. I don’t have any clear answers or solutions just yet. I’m just waiting. Waiting in the unknown is so hard and scary at times. Some days are better than others. I was having a hard time the other day. Just feeling really isolated, helpless, and discouraged. Yesterday I received some packages in the mail from my sweet friends here on Instagram. This beautiful bouquet of flowers and a gift box full of soaps and bath products. It was accompanied by a video message from them. As soon as I saw my friends talking I started crying. I’ve never felt so loved and cared for before. I am so grateful for this sweet homeschool community here on Instagram. And I am so thankful for all of your continued prayers and support through all of this. It means so much to me.

Thank you sweet friends

